import React from 'react';
import './App.css';
import Frame from './components/UI/Frame';

const UserArray=[];


function App(props) {
  const AddNewUser=(props)=>{
    UserArray.push(props.data);
  }

  return (
    <div>
      <Frame userAdd={AddNewUser}/>                  
    </div>
  );
}

export default App;
